// src/pages/CitaConfirmada.js
import React from 'react';

const CitaConfirmada = () => {
  return (
    <div>
      <h1>Cita Confirmada</h1>
      <p>Su cita ha sido confirmada. Puede descargar el resumen de la reserva.</p>
      <button>Descargar Resumen de Cita</button>
    </div>
  );
};

export default CitaConfirmada;
